import React from 'react'
import { Route } from 'react-router-dom';

function Welcome() {
    return (
        <div style={{width: "300px", margin: "0 auto", background: "black", color: "white", padding: "20px", borderRadius: "10px", marginTop: "20px"}}>
            <h1>Welcome Here...</h1>
            <Route path="/welcome/new-user">
                <p style={{textAlign:"center"}}>Welcome, New User!</p>
            </Route>
        </div>
    )
}

export default Welcome;
